package com.active.bean;import java.io.Serializable;/** * 这是一个类说明 * * @date 2019/7/9 下午7:30 * @since 1.0 */public class VisitExportInfo implements Serializable {    private Long id;    private String name;    private String mobile;    private String age;    /**行业**/    private String profession;    /**参观时间**/    private String visitTime;    /**报名时间**/    private String createTime;    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getMobile() {        return mobile;    }    public void setMobile(String mobile) {        this.mobile = mobile;    }    public String getAge() {        return age;    }    public void setAge(String age) {        this.age = age;    }    public String getProfession() {        return profession;    }    public void setProfession(String profession) {        this.profession = profession;    }    public String getVisitTime() {        return visitTime;    }    public void setVisitTime(String visitTime) {        this.visitTime = visitTime;    }    public String getCreateTime() {        return createTime;    }    public void setCreateTime(String createTime) {        this.createTime = createTime;    }}